import Header from "./Header/Header";
import { ChakraProvider } from '@chakra-ui/react'
import Cards from "./Card/Cards";
function App() {
  return (
    <div>
      <Header />
      <h2>Let's get started!</h2>
      <ChakraProvider>
      <Cards />
      </ChakraProvider>
    </div>
  );
}

export default App;
